import React, { Component } from "react";
import { StatusBar } from 'expo-status-bar';
import { TextInput,Alert, Button,StyleSheet, Text, View } from "react-native";
import { LinearGradient } from 'expo-linear-gradient';
import { NavigationContainer, StackActions } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import estilos from './estilos';
import Abastecimento from './Componentes/Abastecimento';
import ListaAbastecimento from './Componentes/ListaAbastecimentos'

export default function App() {

    return (
      <NavigationContainer>
      <Stack.Navigator>
          <Stack.Screen name="ListaAbastecimento" component={ListaAbastecimento}></Stack.Screen>
          <Stack.Screen name="Abastecimento" component={Abastecimento}></Stack.Screen>
      </Stack.Navigator>


      <View style={estilos.fundo}>     
        <View style={estilos.container}>    
          <Text style={{ 
            color: "#c8eb6a", 
            fontSize: 25,
            alignItems:'flex-end',
            paddingTop:20,
            textDecorationStyle:'double' }}> Cadastro Abastecimento</Text>


          <LinearGradient colors={['rgba(38,125,20,1)', 'transparent']}
            style={estilos.background}>

            <Abastecimento> 

            </Abastecimento>


            </LinearGradient>    


        </View>   

      </View>
      </NavigationContainer>
    );
};
